function Postpage() {
  return (
    <div clas>
      <div className='border-bottom border-bottom-2 ps-4 d-flex flex-column mt-1 row-gap-0 overflow-auto'>
        <h2 className='mb-1'>My Fourth post</h2>
        <p className='mb-1'>July 01,2021 11:17:36 AM</p>
        <p className='mb-1'>Lorem ipsum dolor sit ame....</p>
    </div>
    </div>
  )
}

export default Postpage
